insert  into `report_query`(`id`,`reportname`,`style`,`header`,`query`,`crosstab`,`total`,`subtotal`,`order_concat`,`order_by_col_1`,`order_by_col_2`,`order_by_col_3`,`entrytime`,`entryuser`,`entryip`,`updatetime`,`updateuser`,`updateip`) values (4,'RPT_SUMMARY_BY_USIA_A_BY_DEPT',NULL,NULL,'SELECT lvl `Level`,SUM(JmlLK) JmlLK,MAX(genderLK) `LK`,\r\nSUM(JmlPR) JmlPR,MAX(genderPR) `PR`,md.`description` Dept\r\nFROM\r\n(\r\nSELECT ml.`level` lvl, IFNULL(JmlLK,0) JmlLK,\r\nIFNULL(genderLK,\'LK\') genderLK,\r\njmlPR,genderPR,IFNULL(dept,<<parameter1>>) dept\r\nFROM\r\n(\r\nSELECT \'PRA\' lvl,COUNT(malk.noAnggota) JmlLK,\'LK\' genderLK,\r\n0 jmlPR,\'\' genderPR,IFNULL(departemen,99) dept\r\nFROM\r\n(\r\nSELECT a.`noAnggota`,a.`namaAnggota`,b.`level`,a.`departemen`,\r\nIFNULL(YEAR(CURDATE())-YEAR(a.`tglLahir`),0) usia \r\nFROM master_anggota a\r\nINNER JOIN master_level b ON a.`level`=b.`id`\r\nWHERE a.`jnsKelamin`=\'LK\' AND b.`level`=\'PRA\' AND a.`departemen`=<<parameter1>>\r\n) AS malk WHERE (malk.usia BETWEEN 12 AND 25)\r\nGROUP BY dept\r\nUNION ALL\r\nSELECT \'0\' lvl,COUNT(malk.noAnggota) JmlLK,\'LK\' genderLK,\r\n0 jmlPR,\'\' genderPR,IFNULL(departemen,99) dept\r\nFROM\r\n(\r\nSELECT a.`noAnggota`,a.`namaAnggota`,b.`level`,a.`departemen`,\r\nIFNULL(YEAR(CURDATE())-YEAR(a.`tglLahir`),0) usia \r\nFROM master_anggota a\r\nINNER JOIN master_level b ON a.`level`=b.`id`\r\nWHERE a.`jnsKelamin`=\'LK\' AND b.`level`=\'0\' AND a.`departemen`=<<parameter1>>\r\n) AS malk WHERE (malk.usia BETWEEN 12 AND 25)\r\nGROUP BY dept\r\nUNION ALL\r\nSELECT \'1\' lvl,COUNT(malk.noAnggota) JmlLK,\'LK\' genderLK,\r\n0 jmlPR,\'\' genderPR,IFNULL(departemen,99) dept\r\nFROM\r\n(\r\nSELECT a.`noAnggota`,a.`namaAnggota`,b.`level`,a.`departemen`,\r\nIFNULL(YEAR(CURDATE())-YEAR(a.`tglLahir`),0) usia \r\nFROM master_anggota a\r\nINNER JOIN master_level b ON a.`level`=b.`id`\r\nWHERE a.`jnsKelamin`=\'LK\' AND b.`level`=\'1\' AND a.`departemen`=<<parameter1>>\r\n) AS malk WHERE (malk.usia BETWEEN 1